import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Matches = () => {
  const [matches, setMatches] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchMatches();
  }, []);

  const fetchMatches = async () => {
    try {
      const token = localStorage.getItem('token');
      if (!token) {
        window.location.href = '/';
        return;
      }

      const response = await axios.get('http://localhost:5000/api/user/matches', {
        headers: { Authorization: `Bearer ${token}` }
      });

      setMatches(response.data);
      setLoading(false);
    } catch (error) {
      console.error('Matches fetch error:', error);
      if (error.response?.status === 401) {
        localStorage.removeItem('token');
        window.location.href = '/';
      }
    }
  };

  const formatLastActive = (lastActive) => {
    const now = new Date();
    const lastActiveDate = new Date(lastActive);
    const diffInHours = Math.floor((now - lastActiveDate) / (1000 * 60 * 60));

    if (diffInHours < 1) return 'Active now';
    if (diffInHours < 24) return `Active ${diffInHours}h ago`;
    const diffInDays = Math.floor(diffInHours / 24);
    return `Active ${diffInDays}d ago`;
  };

  if (loading) {
    return (
      <div className="flex items-center justify-center min-h-screen bg-gradient-to-r from-pink-400 to-red-400">
        <div className="text-center text-white">
          <div className="w-12 h-12 mx-auto mb-4 border-b-2 border-white rounded-full animate-spin"></div>
          <p className="text-xl">Loading your matches...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="min-h-screen p-4 bg-gradient-to-r from-pink-400 to-red-400">
      {/* Header */}
      <div className="flex items-center justify-between mb-6">
        <h1 className="text-3xl font-bold text-white">Your Matches</h1>
        <div className="space-x-4">
          <button
            onClick={() => window.location.href = '/dashboard'}
            className="px-4 py-2 text-white transition duration-200 border border-white rounded-lg hover:text-gray-200"
          >
            Find More
          </button>
          <button
            onClick={() => window.location.href = '/profile'}
            className="px-4 py-2 text-white transition duration-200 border border-white rounded-lg hover:text-gray-200"
          >
            Profile
          </button>
        </div>
      </div>

      <div className="max-w-6xl mx-auto">
        {matches.length === 0 ? (
          <div className="text-center text-white">
            <div className="mb-4 text-8xl">💔</div>
            <h2 className="mb-4 text-3xl font-bold">No matches yet!</h2>
            <p className="mb-6 text-xl">Keep swiping to find your perfect match</p>
            <button
              onClick={() => window.location.href = '/dashboard'}
              className="px-8 py-3 font-semibold text-pink-500 transition duration-200 bg-white rounded-lg hover:bg-gray-100"
            >
              Start Matching
            </button>
          </div>
        ) : (
          <div className="grid grid-cols-1 gap-6 md:grid-cols-2 lg:grid-cols-3">
            {matches.map((match, index) => (
              <div key={index} className="overflow-hidden transition duration-300 transform bg-white shadow-lg rounded-2xl hover:scale-105">
                <div className="relative">
                  <div className="flex items-center justify-center h-64 bg-gray-200">
                    {match.userId.photos && match.userId.photos.length > 0 ? (
                      <img
                        src={match.userId.photos.find(p => p.isMain)?.url || match.userId.photos[0].url}
                        alt={match.userId.firstName}
                        className="object-cover w-full h-full"
                      />
                    ) : (
                      <div className="text-6xl">👤</div>
                    )}
                  </div>
                  <div className="absolute px-2 py-1 text-xs text-white bg-green-500 rounded-full top-4 right-4">
                    {formatLastActive(match.userId.lastActive)}
                  </div>
                </div>

                <div className="p-4">
                  <h3 className="mb-2 text-xl font-bold">
                    {match.userId.firstName} {match.userId.lastName}
                  </h3>
                  <div className="flex items-center mb-2 space-x-2">
                    <span className="px-2 py-1 text-sm text-purple-600 bg-purple-100 rounded">
                      {match.userId.major}
                    </span>
                    <span className="px-2 py-1 text-sm text-pink-600 bg-pink-100 rounded">
                      {match.userId.year}
                    </span>
                  </div>

                  {match.userId.bio && (
                    <p className="mb-3 text-sm text-gray-600 line-clamp-2">
                      {match.userId.bio}
                    </p>
                  )}

                  <div className="mb-3 text-xs text-gray-500">
                    Matched on {new Date(match.matchedAt).toLocaleDateString()}
                  </div>

                  <button
                    onClick={() => window.location.href = `/messages/${match.userId._id}`}
                    className="w-full py-2 text-white transition duration-200 rounded-lg bg-gradient-to-r from-pink-500 to-red-500 hover:from-pink-600 hover:to-red-600"
                  >
                    Send Message 💬
                  </button>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default Matches;
